import tensorflow as tf

# 1. Sparse Tensor
dense_tensor = tf.constant([[1, 0, 0],
                            [0, 0, 2],
                            [0, 3, 0]])

sparse_tensor = tf.sparse.from_dense(dense_tensor)
print("Sparse Tensor:")
